import { NextApiHandler } from "next";
import puppeteer from "puppeteer";

const Handler: NextApiHandler = async (_req, res) => {
  const browser = await puppeteer.launch({ headless: true, args: ["--no-sandbox", "--disabled-setupid-sandbox"], })
  const page = await browser.newPage()
  const url = "http://localhost:3000" + String(_req.query["url"])
  console.log(url)
  await page.goto(url)
  await page.emulateMediaType('screen')

  const headerTemplate = `
  <div style="display:flex;width:90%;font-size: 10px;padding: 5px 0;margin:auto;border-bottom: 0.5px solid black;">
    <div style="width:25%"><img src="{{image_data}}" style="width:110px;height:45px;"/></div>
    <div style="width:50%;text-align:center"></div>
    <div style="width:25%;text-align:right"><img src="{{image_data2}}" style="width:40px;height:50px;"/></div>
  </div>`


  const logo = "data:image/png;base64,"

  const logo2 = "data:image/jpeg;base64,"

  const customHeader = headerTemplate
    .replace("{{image_data}}", logo2)
    .replace("{{image_data2}}", logo);


  // Create PDF Buffer
  const buffer = await page.pdf({
    format: 'A4',
    printBackground: true,
    // omitBackground: true,
    margin: { top: 100, bottom: 0 },
    displayHeaderFooter: true,
    footerTemplate: `<b>Hello world<b/>`,
    headerTemplate: customHeader,
  });
  // Return pdf buffer to caller.
  res.end(buffer)

  // Close browser **after** we returned the PDF to the caller.
  await browser.close()
}

export default Handler
